//import React from 'react'

export default class UserKeyData {
    constructor(id, calories, protein, carb, lipid) {
        this.userId = id
        this.calorieCount = calories
        this.proteinCount = protein
        this.carbohydrateCount = carb
        this.lipidCount = lipid
    }
}

